var calibrationPoints = flow.get("calibrationPoints") || [];

if (calibrationPoints.length === 2) {
    var p1 = calibrationPoints[0];
    var p2 = calibrationPoints[1];

    var m = (p2.pressureValue - p1.pressureValue) / (p2.rawValue - p1.rawValue);
    var b = p1.pressureValue - m * p1.rawValue;

    var pressure = m * msg.payload + b;
    return { payload: pressure };
} else {
    // Not enough calibration points
    return null;
}

